import React from 'react'
import { styled } from 'styled-components'
import { primaryColorSuperLight } from '../components/colors'
import Crypto from '../components/Crypto'

const Wrapper = styled.div`
  width: 80%;
  height: 500px;
  margin: 0 auto;
  background-color: ${primaryColorSuperLight};
  border-radius: 20px;
  overflow: hidden;
  box-shadow: 0px 0px 5px 1px #Cccccc;
`

function LandingPage() {
  return (
    <Wrapper>
      <Crypto fullName="Bitcoin" ticker="BTC" price="2000$" change="0.01%" logo="https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/800px-Bitcoin.svg.png"/>
    </Wrapper>
  )
}

export default LandingPage
